import { useState } from 'react';

export function Hashing()
{
  const [hashed, setHashed] = useState('');
  const [unhashed, setUnhashed] = useState('');

  return (
    <>
      <p>The hashed statement is: {hashed}</p>
      <p>The unhashed statement is: {hashed}</p>
    </>
  );
}
